# set focus to self for handling the FocusPath variable correctly for
# any parents borrowing from Behavior_FocusNavigation
GenSetFocus(Self);
GenSendMessage(Self, "FocusNext");

if (GenInState(Self.Result.InlineChild[ResourcesEntry_National_Entry], Focused))
	GenSetFocus(Self.Result.InlineChild[ResourcesEntry_Global_Entry]);
elif (GenInState(Self.Result.InlineChild[ResourcesEntry_Local_Entry], Focused))
	GenSetFocus(Self.Result.InlineChild[ResourcesEntry_National_Entry]);
else
	# set focus to self for handling the FocusPath variable correctly for
	# any parents borrowing from Behavior_FocusNavigation
	GenSetFocus(Self);
	GenSendMessage(Self, "FocusPrevious");
endif

